import React, { Component } from 'react';
import './App.css';

import Todo from './components/index';
import TodoList from './components/todoList';

class App extends Component {
  render() {
    return (
      <div>
        <Todo />
        <TodoList />
      </div>
    );
  }
}

export default App;
